import React, { Component } from 'react'
import { ListGroup, ListGroupItem } from "reactstrap";

export default class ProductList extends Component {
    render() {
        return (
            <>
            <h3>{this.props.title} - {this.props.currentCategory}</h3>
            <ListGroup>
                <ListGroupItem>
                    Cras justo odio
                </ListGroupItem>
            </ListGroup>
            </>
        )
    }
}
